// src/components/AddMonster.js
import React, { useState, useEffect } from "react";
import api from "../api";

const SaveMonster = ({ saveMonster, selectedID }) => {
  const [newName, setName] = useState("");
  const [newImageURL, setImageURL] = useState("");
  const [newOwned, setOwned] = useState(false);
  const [newSize, setSize] = useState(0);
  const [newLang, setLang] = useState("");
  const [newDate, setDate] = useState("");

  useEffect(() => {
    if (selectedID !== -1) getSelectedMonsterData();
  }, [selectedID]);

  const getSelectedMonsterData = async () => {
    const selectedMonster = await (await api.get("/" + selectedID)).data;
    // setId(selectedID);
    setName(selectedMonster.name);
    setImageURL(selectedMonster.imageURL);
    setOwned(selectedMonster.owned);
    setSize(selectedMonster.size);
    setLang(selectedMonster.lang);
    setDate(selectedMonster.date);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const newMonster = {
        id: selectedID,
        name: newName,
        imageURL: newImageURL,
        owned: newOwned,
        size: newSize,
        lang: newLang,
        date: newDate,
      };

      if (newMonster.id === -1) {
        const response = await api.post("", newMonster);
      } else {
        const response = await api.put("/" + selectedID, newMonster);
      }
      saveMonster();
      setName("");
      setImageURL("");
      setOwned(false);
      setSize(0);
      setLang("IT");
      setDate("");
    } catch (error) {
      console.error("Error adding monster:", error);
    }
  };

  const handleCancel = () => {
    saveMonster();
  };

  const handleDelete = async (e) => {
    if (selectedID !== -1) {
      const response = await api.delete("/" + selectedID);
      saveMonster();
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      className={isFormVisible ? "edit-form-visible" : "edit-form-hidden"}
    >
      <h2>Monster Details</h2>
      <input
        type="number"
        value={selectedID}
        name="id"
        disabled="true"
        // onChange={(e) => setSelectedID(e.target.value)}
      />
      <input
        type="text"
        placeholder="Name"
        value={newName}
        onChange={(e) => setName(e.target.value)}
        required
        name="name"
      />
      <label for="name">Name</label>
      <input
        type="text"
        placeholder="Image URL"
        value={newImageURL}
        onChange={(e) => setImageURL(e.target.value)}
        required
        name="imageurl"
      />
      <label for="imageurl">Image URL</label>
      <input
        type="checkbox"
        checked={newOwned}
        onChange={(e) => setOwned(e.target.checked)}
        name="owned"
      />
      <label for="owned">Owned</label>
      <input
        type="number"
        value={newSize}
        onChange={(e) => setSize(e.target.value)}
        required
        name="size"
      />
      <label for="<size>">Size</label>
      <select
        defaultValue="IT"
        value={newLang}
        onChange={(e) => setLang(e.target.value)}
        name="lang"
      >
        <option value="IT">IT</option>
        <option value="EN">EN</option>
        <option value="SI">SI</option>
      </select>
      <label for="lang">Lang</label>
      <input
        type="date"
        value={newDate}
        defaultValue={new Date()}
        onChange={(e) => setDate(e.target.value)}
        name="date"
      />
      <label for="date">Date</label>

      <button type="submit">SAVE</button>
      <button onClick={handleCancel}>CANCEL</button>
      {selectedID !== -1 && <button onClick={handleDelete}>DELETE</button>}
    </form>
  );
};

export default SaveMonster;
